import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div id="venderSplash">
        <div>
          <input type="text" placeholder="email"></input> <br />
          <input type="password" placeholder="password"></input> <br />
          <button type="submit" onClick={loadBuilder()}>Log In</button>
        </div>
      </div>
    </div >
  );
}

function loadBuilder() {
  return (
    <div className="App">
      Hello World
    </div >
  );
}

export default App;
